import React, { useState, useEffect } from "react";
import { Menu } from "semantic-ui-react";
import ModalDim from "./ModalDim";
import { Link } from "react-router-dom";
import { Button, Segment } from "semantic-ui-react";

export default function Navbarr() {
  const [activeItem, setActiveItem] = useState("home");

  return (
    <div>
      <Segment inverted>
        <Menu pointing inverted secondary stackable size="large">
          <Menu.Item>
            <img src="https://react.semantic-ui.com/logo.png" />
          </Menu.Item>
          <Menu.Item
            name="home"
            active={activeItem === "home"}
            onClick={(e) => setActiveItem("home")}
          >
            <Button inverted>
              <Link to="/Home">Home</Link>
            </Button>
          </Menu.Item>
          <Menu.Item
            name="den"
            active={activeItem === "den"}
            onClick={(e) => setActiveItem("den")}
          >
            <Button inverted>
              <Link to="/404NotFound">Den</Link>
            </Button>
          </Menu.Item>
          <Menu.Menu position="right">
            <Menu.Item>
              <ModalDim title="Sign In" value="signin" />
            </Menu.Item>
            <Menu.Item>
              <ModalDim title="Sign Up" value="signup" />
            </Menu.Item>
          </Menu.Menu>
        </Menu>
      </Segment>
    </div>
  );
}
